-- Extensions
CREATE EXTENSION IF NOT EXISTS postgis;

CREATE TABLE Commune_Contour
(
    typecom character varying(4) NOT NULL DEFAULT 'COM',
    com     character varying(5) NOT NULL,
    contour geometry             NOT NULL,
    PRIMARY KEY (typecom, com)
);

CREATE TABLE ref_typereg(
                            code character varying(2) PRIMARY KEY,
                            label text NOT NULL,
                            color character varying(7) NOT NULL
);


CREATE TABLE zone_pprn(
                          id_zone TEXT NOT NULL PRIMARY KEY,
                          id_gaspar character varying(20) NOT NULL,
                          nom TEXT,
                          codezone TEXT,
                          typereg character varying(2) NOT NULL REFERENCES ref_typereg(code),
                          urlfic TEXT,
                          area geometry NOT NULL
);

